import Col from 'react-bootstrap/Col';

function FootComponent() {
	return (
		<div>
			<footer className="footer bg-footer">
				<br />
				<br />
				<br />
				<h1 className="text-dark"> JAck Shit</h1>
			</footer>
		</div>
	);
}

export default FootComponent;
